function myCheckboxCtrl($scope) {
  $scope.selected = {};
  $scope.classes = [
    'size1',
    'size2',
    'size3'
  ];
  $scope.cards = [
    {
      name: 'Result1',
      size: 'size1',
      price: 'price1'
    },
    {
      name: 'Result2',
      size: 'size1',
      price: 'price2'
    },
    {
      name: 'Result3',
      size: 'size1',
      price: 'price3'
    },
    {
      name: 'Result4',
      size: 'size2',
      price: 'price1'
    },
    {
      name: 'Result5',
      size: 'size2',
      price: 'price2'
    },
    {
      name: 'Result6',
      size: 'size2',
      price: 'price3'
    },
    {
      name: 'Result7',
      size: 'size3',
      price: 'price1'
    },
    {
      name: 'Result8',
      size: 'size3',
      price: 'price2'
    },
    {
      name: 'Result9',
      size: 'size3',
      price: 'price3'
    }
  ];
  function isChecked(obj) {
    var checked = [];
    for (var key in obj) {
      if (obj[key]) {
        checked.push(key);
      }
    }
    return checked;
  }
  $scope.showCards = function (card) {
    var checked = isChecked($scope.selected);
    if (checked.length < 1) {
      checked = $scope.classes;
    }
    return checked.indexOf(card.size) > -1;
  };
}
